import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

let IMG = "https://picsum.photos/250/300"
let IMG2 = "https://picsum.photos/260/300"


let Heading ={
        color: "red",
        textAlign: "center",
        fontSize :"2rem",
        fontFamily: "'Trebuchet MS', 'Lucida Sans Unicode', 'Lucida Grande', 'Lucida Sans', Arial, sans-serif"
}

ReactDOM.render(
    <>
         {/* Inline Css */}
        {/* <h1 style={{color: "red",
        textAlign: "center"}}   contentEditable="true">Himanshu</h1> */}

        <h1 style={Heading} contentEditable="true">Himanshu</h1>


        <div className='Img-Div'>
        <img src={IMG} alt='Img'/>
        <img src={IMG2} alt='Img2'/>
        </div>
    </>,
    document.getElementById('root')
)
